(1,'Panduan 1','2023-01-06','TATA TERTIB DAN JADWAL WAWANCARA SELEKSI MUTASI INTERNAL PEGAWAI NEGERI SIPIL DI LINGKUNGAN KEMENTERIAN KESEHATAN TAHUN 2021 A. TATA TERTIB WAWANCARA 1. Setiap peserta seleksi mutasi internal Pegawai Negeri Sipil yang telah dinyatakan lolos seleksi administrasi pada Pengumuman Nomor KP.02.03/IV/5907/2022 tanggal 14 Juni 2022 wajib mengikuti wawancara secara daring (online) sesuai dengan jadwal masing-masing sebagaimana tercantum pada poin B. 2. Waktu pelaksanaan wawancara mengacu pada Waktu Indonesia Barat (WIB) sehingga bagi peserta yang berada di wilayah lain agar menyesuaikan. 3. Tautan (link) video conference akan disampaikan melalui email pada 1 (satu) hari sebelum jadwal ujian masing-masing peserta. Untuk kepentingan keamanan video conference, email yang berisi link join video conference dilarang disebarluaskan ke pihak yang tidak berkepentingan.','%PDF-1.7\r\n%µµµµ\r\n1 0 obj\r\n<</Type/Catalog/Pages 2 0 R/Lang(en-ID) /StructTreeRoot 21 0 R/MarkInfo<</Marked true>>/Metadata 67 0 R/ViewerPreferences 68 0 R>>\r\nendobj\r\n2 0 obj\r\n<</Type/Pages/Count 2/Kids[ 3 0 R 17 0 R] >>\r\nendobj\r\n3 0 obj\r\n<</Type/Page/Parent 2 0 R/Resources<</XObject<</Image5 5 0 R/Image13 13 0 R>>/ExtGState<</GS7 7 0 R/GS10 10 0 R>>/Font<</F1 8 0 R/F2 11 0 R/F3 15 0 R>>/ProcSet[/PDF/Text/ImageB/ImageC/ImageI] >>/MediaBox[ 0 0 595.32 841.92] /Contents 4 0 R/Group<</Type/Group/S/Transparency/CS/DeviceRGB>>/Tabs/S/StructParents 0>>\r\nendobj\r\n4 0 obj\r\n<</Filter/FlateDecode/Length 3394>>\r\nstream\r\nxœÍ[İsÛ6÷Œÿ<R76E€ ¯Î(qê8\\â\\ê>PM1)U\"ãóıõ·»\0)Zê6¢zmgd\0±‹Å~üvŒ\'ë*»ï*öããIUÅwódÆ~ß,W¿oWÉøCœfe\\eËrü©VØô:‰gÉú§ŸØ‹‹—l|ùI²tszòÛé‰çE¶d2àv$˜\'íÀõ™çÚ[\'§\'_şÁJ¢ZøŸz|rWœŒ¯Š8M|v±dÿ¢IÛÁÿÂPrøÈ|Û,ôèƒí¼/nàÓŸ9ã!»¹?=áD^ß&C \"Ø\rÌï°F^~âqí°ËÓ“_¬õÈ·ŠxÎ>Åy6:w­Š~e7oNO^ÁÄ0\"$Œ“=F4ù›$ûV¹\\,Ó8a£sa]•ğt¿\\ãso²aòDdû¾‰¡ï]ı÷0ÙQğtÓ\"n».“2°ı>koPRDäYãÑy`=bKŒ?‡nZ!B;ŒL¬¼EâQ`£óÈZÕ#ÏÚŒÜ#pHÛã&.>—õè<´fƒS…mÆµŸ\rOÎµCã\"‡—i<§dYrÆèÖğ+­òlp>\\pƒÜ7ññbä)Í¡r•)²2