/*Table structure for table `tb_panduan_detail` */

DROP TABLE IF EXISTS `tb_panduan_detail`;

CREATE TABLE `tb_panduan_detail` (
  `id_panduan` int(11) NOT NULL AUTO_INCREMENT,
  `id_pegawai` int(11) DEFAULT NULL,
  UNIQUE KEY `id_panduan` (`id_panduan`,`id_pegawai`),
  KEY `id_pegawai` (`id_pegawai`),
  CONSTRAINT `tb_panduan_detail_ibfk_1` FOREIGN KEY (`id_panduan`) REFERENCES `tb_panduan` (`id_panduan`),
  CONSTRAINT `tb_panduan_detail_ibfk_2` FOREIGN KEY (`id_pegawai`) REFERENCES `tb_pegawai` (`id_pegawai`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4;

