/*Table structure for table `tb_pegawai` */

DROP TABLE IF EXISTS `tb_pegawai`;

CREATE TABLE `tb_pegawai` (
  `id_pegawai` int(11) NOT NULL AUTO_INCREMENT,
  `id_jabatan` int(11) DEFAULT NULL,
  `id_bidang` int(11) DEFAULT NULL,
  `id_ruangan` int(11) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `password_pg` varchar(255) DEFAULT NULL,
  `nip` varchar(18) DEFAULT NULL,
  `nama` varchar(255) DEFAULT NULL,
  `foto_profile` mediumblob DEFAULT NULL,
  `no_hp` varchar(15) DEFAULT NULL,
  `alamat` varchar(255) DEFAULT NULL,
  `kecamatan` varchar(255) DEFAULT NULL,
  `kabupaten` varchar(255) DEFAULT NULL,
  `negara` varchar(255) DEFAULT NULL,
  `agama` varchar(255) DEFAULT NULL,
  `jenis_kelamin` enum('L','P') DEFAULT NULL,
  `golongan_darah` enum('A','B','AB','O') DEFAULT NULL,
  `tempat_lahir` varchar(255) DEFAULT NULL,
  `tgl_lahir` date DEFAULT NULL,
  `status_kawin` enum('Kawin','Belum Kawin') DEFAULT NULL,
  `no_ktp` varchar(16) DEFAULT NULL,
  `file_ktp` mediumblob DEFAULT NULL,
  `tahun_masuk` year(4) DEFAULT NULL,
  `jenis_kontrak` varchar(255) DEFAULT NULL,
  `tgl_buat` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id_pegawai`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `nip` (`nip`),
  UNIQUE KEY `no_ktp` (`no_ktp`),
  KEY `id_jabatan` (`id_jabatan`),
  KEY `id_bidang` (`id_bidang`),
  KEY `id_ruangan` (`id_ruangan`),
  CONSTRAINT `tb_pegawai_ibfk_1` FOREIGN KEY (`id_jabatan`) REFERENCES `tb_jabatan` (`id_jabatan`),
  CONSTRAINT `tb_pegawai_ibfk_2` FOREIGN KEY (`id_bidang`) REFERENCES `tb_bidang` (`id_bidang`),
  CONSTRAINT `tb_pegawai_ibfk_3` FOREIGN KEY (`id_ruangan`) REFERENCES `tb_ruangan` (`id_ruangan`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4;

