/*Table structure for table `tb_pengajuan` */

DROP TABLE IF EXISTS `tb_pengajuan`;

CREATE TABLE `tb_pengajuan` (
  `id_pengajuan` int(11) NOT NULL AUTO_INCREMENT,
  `id_pegawai` int(11) DEFAULT NULL,
  `jenis_pengajuan` enum('Pengajuan Cuti Tahunan','Pengajuan Cuti Melahirkan','Pengajuan Naik Tingkat') DEFAULT NULL,
  `tgl_masuk` date DEFAULT NULL,
  `tgl_konfirmasi` date DEFAULT NULL,
  `status_pengajuan` enum('Diterima','Pending','Ditolak') DEFAULT NULL,
  `konten` text DEFAULT NULL,
  `media` mediumblob DEFAULT NULL,
  PRIMARY KEY (`id_pengajuan`),
  KEY `id_pegawai` (`id_pegawai`),
  CONSTRAINT `tb_pengajuan_ibfk_1` FOREIGN KEY (`id_pegawai`) REFERENCES `tb_pegawai` (`id_pegawai`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;

/*Data for the table `tb_pengajuan` */

insert  into `tb_pengajuan`(`id_pengajuan`,`id_pegawai`,`jenis_pengajuan`,`tgl_masuk`,`tgl_konfirmasi`,`status_pengajuan`,`konten`,`media`) values 
(1,5,'Pengajuan Cuti Tahunan','2023-01-06','2023-01-06','Ditolak','Sehubungan dengan Cuti Bersama pada Selasa, 24 Desember 2020 dan libur nasional pada 25 Desember 2020, Bersama hal tersebut disampaikan beberapa hal sebagai berikut: 1. Pelayanan Poliklinik Tutup. 2. Pelayanan Instalasi Gawat Darurat tetap buka seperti biasa. 3. Pelayanan Rawat Inap tetap buka seperti biasa. 4. Pelayanan Hemodialisa (HD) tetap seperti biasa. 5. Pelayanan Penunjang Medis tetap seperti biasa.','%PDF-1.7\r\n%µµµµ\r\n1 0 obj\r\n<</Type/Catalog/Pages 2 0 R/Lang(en-ID) /StructTreeRoot 21 0 R/MarkInfo<</Marked true>>/Metadata 56 0 R/ViewerPreferences 57 0 R>>\r\nendobj\r\n2 0 obj\r\n<</Type/Pages/Count 1/Kids[ 3 0 R] >>\r\nendobj\r\n3 0 obj\r\n<</Type/Page/Parent 2 0 R/Resources<</XObject<</Image5 5 0 R/Image13 13 0 R/Image15 15 0 R>>/ExtGState<</GS7 7 0 R/GS10 10 0 R>>/Font<</F1 8 0 R/F2 11 0 R/F3 16 0 R/F4 18 0 R>>/ProcSet[/PDF/Text/ImageB/ImageC/ImageI] >>/MediaBox[ 0 0 595.32 841.92] /Contents 4 0 R/Group<</Type/Group/S/Transparency/CS/DeviceRGB>>/Tabs/S/StructParents 0>>\r\nendobj\r\n4 0 obj\r\n<</Filter/FlateDecode/Length 2176>>\r\nstream\r\nxœÍ[moÛ¶ş ÿ¥a¡ù.òb°6[_†]ãaÚ}ÇÑµcûÚ¶şûCÙsR‰nç®‹¶ø<‡<¯$5øaUW×å§š}÷İà‡º.?İŒ¯Ø‡Áp±üc0ü¼Ş•“j^ÖÕb>¸lF56½—WãÕ÷ß³ç/ÙàÕeÁ&ëÓ“ÿxÁ\n\'yPÌÜiËŒæ­Æ§\'¿Ãæğ“¶UÀÿøÍ½G>İŞÜ–“±eçökìTpÿ¼/$<dƒåZ1oâ»~_áÑŸ$“\r¯OOdD€[g¹w¬ğ€¢Øúl¿|u)Ed-Ø«Ó“Ùû&·ÙmyÃ.Ëi•Ÿé¬fùløöôäGè˜€ˆ*àwE‡È~8æg6›/f‹ILX~¦²7søt½XáçÛr]Ñ2*pëS„*ıSˆÜıI’kÍŠÂqÛ¥öGjÆaˆLö¾ÌÏ\\ö[J¼:i*JyîCŠÊÏÈ¡Ì]v›Ÿ…lÙä&[çú,\\ÁìgÁ°oïar?}È~›“C{Áeb.\0Z\n›+r`P•ùoéá4÷‰!~º9ìsÜà>¯@©|6*Ñ­àZdä“«µçr^é8·ß’K¯ÁõË¤ô/rÓZó\ZÔ|‚@O¡ğ<ìİEÑ½ĞNRC¡yHjöÿÕó*c¹‚Qq¶¢`.Æ³%?†o¶r@¢‘÷`ı„Q6jİ_xáx{«—)Y?f¨æ±^$^>æ¹os·\"Å/ÜyüMÔ}Ë°‚+İKòùtS1	Ceî+Ê°Â*®ı¿”8Ô`ş¥Ü”å¤S\Z»)@Y\nH#!·’AçVA mg)h6Û4@\nŞªÕ¬}ıŸqhŒĞpÛ4ZøŸ°ëÆÅ~õ®H çfÛÕÅGÄ¶›ë(A0ñ<ˆÍÄ2 #ï!±G\'~q÷÷»²¶a?^¼dlğK¤‹—oÎ™Ø”>\0…a¤`Ú+îó2ÆôÀÍ¬¶±â÷¸fS`röEĞ³†DÙ~è®†¾hİŸÉËã:¨FxîŠj3Ÿ˜\\tµâI<¥ˆÁŒIƒQ•së|Á`=†Úãv4ÆTqEéês	\ZB\ZK	¬´àJ\n‰¾Å¨Ê×±